import React, { Component } from "react";

export class StartLeft extends Component {
  render() {
    return (
      <div class="startleft">
        <img src="./images/лого_дизайн 1.png" alt="none" />
        <p>Жаккардовые обои из кварцевой нити под покраску</p>
      </div>
    );
  }
}

export default StartLeft;
